import React, {useState, useEffect } from 'react';
import axios from "axios"
import {
  LineChart,
  Line,
  XAxis,
  YAxis,
  CartesianGrid,
  Tooltip,
  Legend
} from 'recharts';


const ListaDiaria = () => {
    const [cidades, setCidade] = useState([]);
    // const [loading, setLoading] = useState(false);
  
    const getListadata = async () => {
        try {
            const data = await axios.get(
                "http://localhost:5000/lista_diaria/"
                );
                console.log(data);
                setCidade(data.data);
                // setLoading(true);
  
        } catch (e) {
            console.log(e);
        }
    };

const columns = ["cidade", "data", "casos", "mortes"];

useEffect(() => {
    getListadata();
}, []);


    return (
      <LineChart
        width={800}
        height={600}
        data={cidades}
        columns={columns}
        margin={{top: 5, right: 30, left: 20, bottom: 5}}
        >
        <Line
          type='cidade'
          dataKey='casos'
          stroke='#FF8C00'
          activeDot={{r: 12}}
          />
        <CartesianGrid strokeDasharray='4 4'/>
        <Tooltip/>
        <YAxis/>
        <XAxis dataKey='data'/>
        <Line  type="monotone" dataKey="cidade" stroke="#FF8C00" />
        <Legend />
      </LineChart>
    );
  
}

export default ListaDiaria;
